This provides the necessary overloads to provide correct and complete typings for `_.pick` by annotation or by type inference.

```
const o = {
  key1: [1, 2, 3],
  key2: "hello world"
}
let x = _.pick(o, ["key1"]);
x = _.pick(o, "key1");

// typeof x === {key1: number[]}

const key = "key1";
let y = _.pick(o, key);
y = _.pick(o, [key]);

// typeof y === {key1: number[]}

const keys: string[] = ["key1", "key2"];
let z = _.pick(o, keys);

/*
typeof z === Partial<{
  key1: number[],
  key2: string
}>
*/
```
